import React from 'react';

export default function Header({ activePage, setActivePage, user, logout }) {
  return (
    <header className="navbar">
      <div className="logo">Desai Dental Clinic</div>
      <nav>
        <button onClick={() => setActivePage('home')}>Home</button>
        <button onClick={() => setActivePage('appointment')}>Book</button>
        {!user && <button onClick={() => setActivePage('login')}>Login</button>}
        {user && (
          <>
            {user.role === 'admin' && <button onClick={() => setActivePage('admin')}>Doctor Dashboard</button>}
            {user.role === 'patient' && <button onClick={() => setActivePage('patient')}>My Portal</button>}
            <button onClick={logout}>Logout</button>
          </>
        )}
      </nav>
    </header>
  );
}
